import React, { useState } from "react";
import "./Header.css";
import HeaderOptions from "./HeaderOptions/HeaderOptions";
import InfoIcon from "@mui/icons-material/Info";

const Pageheader = (props) => {
  const [toggleNavBar, setToggleNavBar] = useState(false);

  const handleNavBarMenu = () => {
    setToggleNavBar(!toggleNavBar);
  };

  return (
    <>
      <nav className={`header ${toggleNavBar ? "mobile-menu" : ""}`}>
        <div className="header_left">
          <span>Logo</span>
        </div>
        <div className={`header_right ${toggleNavBar ? "hidden" : ""}`}>
          <HeaderOptions Icon={InfoIcon} title="About" />
          <HeaderOptions Icon={InfoIcon} title="Our Services" />
        </div>
        <button onClick={handleNavBarMenu} className="burger-menu">
          <div className={`burger ${toggleNavBar ? "active" : ""}`}>
            <span></span>
            <span></span>
            <span></span>
          </div>
        </button>
      </nav>
    </>
  );
};

export default Pageheader;
